function glow(obj:MovieClip):Void
{// Создаём переменные для хранения параметров
	var color:Number = 0xffffff;// Цвет от 0x000000 до 0xFFFFFF
	var alpha:Number = 1;// Прозрачность от 0 до 1
	var blurX:Number = 2;// Блюр по Х от 0 до 255
	var blurY:Number = 2;// Блюр по У от 0 до 255
	var strength:Number = 10;// Интенсивность от 0 до 255
	var quality:Number = 3;// Качество от 1 до 15
	var inner:Boolean = false;// Внешний (false), внутренний (true)
	var knockout:Boolean = false;// Скрыть обьект или нет
	// Применяем фильтр к мувику
	obj.filters = [new GlowFilter(color, alpha, blurX, blurY, strength, quality, inner, knockout)];
}
function glowout(obj:MovieClip):Void
{
	obj.filters = [];
}
